import logo from './logo.svg';
import './App.css';
import {Mainchara, Nagisa} from'./animal';
import {introduce} from'./introduce';
function App() {
  const apple = new Mainchara(`apple`,'ball','red')  
  const orange = new Mainchara('orange','ball','orange')
  const banana = new Mainchara('banana','curve','yellow')

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{apple.introduce()}</p>
        <p>{orange.introduce()}</p>
        <p>{banana.introduce()}</p>

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
